export const iconAnimationConfig: any = ({
	fill = ICON_BLUE,
	stroke = ICON_BLUE,
}: IconProps) => {
	const color = (fill || stroke) ?? DOMAIN_MODEL_COLORS.root;
	const hiddenColor = chroma(color).alpha(0).css();
	const visibleColor = chroma(color).alpha(1).css();

	return {
		hidden: {
			pathLength: 0,
			fill: hiddenColor,
		},
		visible: {
			pathLength: 1,
			fill: visibleColor,
		},
	};
};

